public class Solution {
    public int MinimumArrayLength(int[] nums) {
        bool hasZero = false;
        int gcd = 0;
        foreach (int num in nums) {
            if (num == 0) {
                hasZero = true;
            } else {
                gcd = GCD(gcd, num);
                if (gcd == 1) {
                    return 1;
                }
            }
        }
        return hasZero ? 1 : 2;
    }

    private int GCD(int a, int b) {
        while (b != 0) {
            int temp = b;
            b = a % b;
            a = temp;
        }
        return a;
    }
}
